    false,nt"url": null,nt"notes": "EARTHQUAKE_EPICENTERS_IN, derived from
    EARTHQUAKE_EPI, is a point-based ESRI ArcView shapefile that shows the locations
    of all known historical earthquakes in Indiana. EARTHQUAKE_EPI includes earthquake
    locations derived from both instrumented recordings and calculations from historical
    accounts. The shapefile is an amalgam of points created from catalogs maintained
    by Saint Louis University, Department of Earth and Atmospheric Sciences and the
    U.S. Geological Survey National Earthquake Information Center. The point attributes
    include: source catalog, earthquake date, magnitude value, and magnitude code. The
    magnitude codes describe the methodologies used to determine the magnitude values.",nt"license_title":
